var wdH = 0,
    wdW = 0;

function winresize() {
    wdH = $(window).height();
    wdW = $(window).width();
}

;
$(document).ready(function() {
    "use strict";
    winresize();


    if ($(window).width() >= 1200) {
        $('.dropdown').mouseover(function() {
            $(this).addClass("open");
        }).mouseout(function() {
            $(this).removeClass("open");
        });
        $('.mainMenu ul.nav > li > a').removeAttr("data-toggle");
    }

    //Search////////////////////////////////////////////////
    $("#dropdownSearchBtn").click(function() {
        $(".search").fadeToggle(200, function() {
            $("#searchinput").focus();
        });
        return false;
    });
    $("#searchclose").click(function() {
        $(".search").fadeToggle(200, function() {
            $("#dropdownSearchBtn").show();
        });
        return false;
    });

    var revapi;
    revapi = jQuery('.home-banner .tp-banner').revolution({
        delay: 4000,
        startwidth: 1140,
        startheight: 585,
        hideThumbs: 10,
        fullWidth: "off",
        forceFullWidth: "off",
        touchenabled: "off"
    });

    if ($('.count').length) {
        $(".counter").countimator();
    }

    $(".block-prizeList .owl-carousel").owlCarousel({
        items: 1,
        margin: 0,
        loop: true,
        dots: false,
        lazyLoad: true,
        navRewind: true,
        autoplay: true,
        nav: false,
        navText: ["<i class='fa fa-angle-left'></i>", "<i class='fa fa-angle-right'></i>"],
        singleItem: true,
        autoHeight: false,
        transitionStyle: "fade",
        responsive: {
            0: {
                items: 1
            },
            600: {
                items: 2,
                margin: 15
            },
            1000: {
                items: 1
            }
        }
    });

    $(".block-membersOther .owl-carousel").owlCarousel({
        items: 4,
        margin: 15,
        loop: true,
        nav: true,
        lazyLoad: true,
        navRewind: true,
        autoplay: true,
        autoplayTimeout: 3000,
        autoplayHoverPause: true,
        navText: ["<i class='fa fa-angle-left'></i>", "<i class='fa fa-angle-right'></i>"],
        slideBy: 1,
        dots: false,
        responsive: {
            0: {
                items: 1
            },
            600: {
                items: 2
            },
            1000: {
                items: 4
            }
        }
    });

    $('#shareHoldersInfo').bind('change', function() {
        var url = $(this).val();
        if (url != '') {
            window.location = url;
        }
        return false;
    });

    $('.video-iframe, .maps-iframe').fancybox({
        'padding': 0,
        type: "iframe",
        helpers: {
            overlay: {
                locked: false
            }
        }
    });

    $('.fancybox-thumbs, .popup-video').fancybox({
        'padding': 0,
        helpers: {
            overlay: {
                locked: false
            }
        }
    });

    $('.prj-box').flexslider({
        animation: "slide",
        controlNav: true
    });

    // Tuyen Dung
    if (wdW >= 1600) {
        $('.fancy').fancybox({
            openEffect: 'elastic',
            closeEffect: 'elastic',
            prevEffect: 'fade',
            nextEffect: 'fade',
            fitToView: true,
            maxWidth: "90%",
            type: 'iframe',
            scrolling: 'no',
            iframe: {
                scrolling: 'no'
            },
            helpers: {
                overlay: {
                    locked: false
                }
            }
        });
    }

    if (wdW > 992 && wdW < 1600) {
        $('.fancy').fancybox({
            maxWidth: "90%",
            type: 'iframe',
            scrolling: 'no',
            iframe: {
                scrolling: 'yes'
            },
            helpers: {
                overlay: {
                    locked: false
                }
            }
        });
    }

    if (wdW <= 992) {
        $('.fancy').fancybox({
            maxWidth: "100%",
            height: "120%",
            type: 'iframe',
            scrolling: 'no',
            iframe: {
                scrolling: 'yes'
            },
            helpers: {
                overlay: {
                    locked: false
                }
            }
        });
    }

    /*if (wdW >= 768) {
        var itemId = $('.item-prj');
        compareItem(itemId);
    }

    var itemFl = $('.item-fields, .item-news');
    compareItem2(itemFl);*/

    $('map').imageMapResize();

    var timer;
    var delay = 300;

    $("area").hover(function() {
        var hoverImg = $(this).attr('data-img');
        timer = setTimeout(function() {
            $('.imageMap').attr('src', hoverImg);
            if (!hoverImg) {
                $('.imageMap').attr('src', '/Data/Sites/1/media/he-thong/tong-the.jpg');
            }
        }, delay);
    }, function() {
        clearTimeout(timer);
    });

    $('.searchBox input').keypress(function(e) {
        if (e.which == 13) {
            $('.searchBox button').click();
            return false;
        }
    });

    // Gallery Projects
    $('.slider-for').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        fade: false,
        asNavFor: '.slider-nav'
    });

    $('.slider-nav').slick({
        slidesToShow: 4,
        slidesToScroll: 1,
        asNavFor: '.slider-for',
        dots: false,
        centerPadding: '60px',
        speed: 300,
        focusOnSelect: true,
        responsive: [{
            breakpoint: 992,
            settings: {
                slidesToShow: 4
            }
        }, {
            breakpoint: 768,
            settings: {
                slidesToShow: 2
            }
        }, {
            breakpoint: 480,
            settings: {
                slidesToShow: 2
            }
        }]
    });

    //Admin slide
    $('.slide-for').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: false,
        fade: true,
        adaptiveHeight: true,
        asNavFor: '.slide-nav'
    });

    $('.slide-nav').slick({
        slidesToShow: 4,
        slidesToScroll: 1,
        asNavFor: '.slide-for',
        dots: false,
        speed: 300,
        focusOnSelect: true,
        responsive: [{
            breakpoint: 992,
            settings: {
                slidesToShow: 4
            }
        }, {
            breakpoint: 768,
            settings: {
                slidesToShow: 2
            }
        }, {
            breakpoint: 480,
            settings: {
                slidesToShow: 2
            }
        }]
    });

    /*Left Menu Admin*/
    $('.leftMenuAdmin a[href^="#"]').click(function(e) {
        e.preventDefault();
        $('html,body').animate({
            scrollTop: $(this.hash).offset().top - 100
        }, 700);
        $('.leftMenuAdmin a').removeClass('active');
        $(this).addClass('active');
        return false;
    });

    $('.fancy-video').fancybox({
        'padding': 0,
        'type': 'iframe',
        helpers: {
            title: null,
            overlay: {
                locked: false
            }
        }
    });

    $('.header').scrollToFixed();
    if ($(window).width() >= 1200) {
        $('.leftMenuAdmin .sub-menu').scrollToFixed({
            marginTop: $('.header').outerHeight(true),
            zIndex: 999
        });
        $('.block-formLink').scrollToFixed({
            marginTop: $('.leftMenuAdmin .sub-menu').outerHeight(true) + 105,
            zIndex: 999
        });
    }

    if (wdW >= 1200) {
        if ($('.pattern-overlay').length > 0) {
            var heightVideo = $(window).innerHeight() + 90;
            $('.video-section .pattern-overlay').css('min-height', heightVideo);
            $(".player").mb_YTPlayer();

            $('.video-mobile').remove();
        }
    }

    if (wdW <= 1199 && wdW >= 768) {
        $('.video-section').remove();
        $('.video-mobile').html(function(i, html) {
            return html.replace(/(?:https:\/\/)?(?:www\.)?(?:youtube\.com|youtu\.be)\/(?:watch\?v=)?(.+)/g, '<iframe width="100%" height="480" src="http://www.youtube.com/embed/$1?rel=0&amp;autoplay=1&amp;showinfo=0" frameborder="0" allowfullscreen></iframe>');
        });
    }
    if (wdW <= 767) {
        $('.video-section').remove();
        $('.video-mobile').html(function(i, html) {
            return html.replace(/(?:https:\/\/)?(?:www\.)?(?:youtube\.com|youtu\.be)\/(?:watch\?v=)?(.+)/g, '<iframe width="100%" height="250" src="http://www.youtube.com/embed/$1?rel=0&amp;autoplay=1&amp;showinfo=0" frameborder="0" allowfullscreen></iframe>');
        });
    }

});

